INSERT INTO `classrooms` VALUES (1,_binary '','2024-08-22 06:20:00.000000','2024-08-27 23:48:06.308477',1,'100','디지털 드로잉: 빛과 그림자의 완벽한 이해',NULL,'첫 강의는 2024년 9월 10일에 시작되며 매주 화요일과 목요일 오후 7시에 진행됩니다. 태블릿과 드로잉 소프트웨어는 필수입니다.','이 강의는 빛과 그림자를 활용한 디지털 드로잉 기법에 대해 깊이 있게 다룹니다. 작품에 입체감을 부여하고, 사실적인 표현을 할 수 있도록 돕습니다.','김서준 교수는 디지털 아트 분야에서 10년 이상의 경력을 가진 베테랑으로, 국내외 여러 전시회에 참가한 경험이 있습니다.','빛과 그림자를 활용해 작품의 질감을 높이고, 사실적인 표현을 완성하는 것을 목표로 합니다.','기본적인 드로잉 기술이 필요하며, 디지털 툴에 익숙하면 좋습니다.'),(2,_binary '','2024-08-22 06:25:00.000000','2024-08-28 11:36:47.859335',2,'101','스티븐 끈적끈적',NULL,'매주 수요일 저녁 8시에 진행됩니다. 2024년 9월 13일 첫 강의가 시작되며, 준비물은 연필과 펜입니다.','이 강의는 연필과 펜을 사용하여 인물의 특징을 섬세하게 표현하는 방법을 중점적으로 다룹니다. 얼굴 비례와 명암 표현을 통해 사실적 인물화를 완성해 나갑니다.','이지아 강사는 프리랜서 일러스트레이터로, 그녀만의 독특한 인물 묘사 기법으로 여러 작품을 발표한 바 있습니다.','인물 드로잉의 기본부터 심화 테크닉까지 익히는 것을 목표로 합니다.','기본적인 인물 비례 이해와 드로잉 경험이 필요합니다.'),(3,_binary '','2024-08-22 06:30:00.000000',NULL,3,'102','색과 재료로 완성하는 공예 작품 만들기',NULL,'강의는 매주 월요일 오후 2시에 시작됩니다. 첫 수업은 2024년 9월 17일이며, 재료비는 별도로 안내드립니다.','다양한 재료와 색채 조합을 통해 나만의 공예 작품을 만들어 보는 실습 중심의 강의입니다. 소품부터 대형 작품까지 다양하게 다룹니다.','박하준 교수는 공예 예술 분야에서 15년 이상의 경력을 보유한 아티스트로, 공예와 디자인을 접목한 작품을 다수 선보였습니다.','색감과 재료의 조화를 통해 개성 있는 공예 작품을 제작하는 능력을 기르는 것을 목표로 합니다.','기본 공예 기술이 있으면 좋지만, 초보자도 수강 가능합니다.'),(4,_binary '','2024-08-22 06:35:00.000000','2024-08-28 13:19:13.979920',4,'103','집에서 만드는 셰프급 요리: 실전 레시피 공개',NULL,'첫 강의는 2024년 9월 19일에 시작되며 매주 금요일 저녁 7시에 진행됩니다. 모든 재료는 사전에 준비 안내 드립니다.','일상적인 재료로 셰프 수준의 요리를 만들어 보는 강의입니다. 실전에서 사용되는 조리 비법을 통해 고급스러운 맛을 내는 방법을 배웁니다.','정유나 셰프는 다수의 요리 대회 수상 경력을 보유하고 있으며, 고급 요리 레스토랑을 운영하고 있습니다.','일상 속 재료로 전문가 수준의 요리를 완성하는 것이 이 강의의 목표입니다.','기본적인 요리 기술과 칼 사용 능력이 요구됩니다.'),(5,_binary '','2024-08-22 06:40:00.000000','2024-08-28 13:17:06.393000',5,'104','홈베이킹: 초코 브라우니부터 마카롱까지',NULL,'강의는 2024년 9월 15일 시작되며 매주 화요일 오후 3시에 진행됩니다. 준비물은 첫 수업 전에 안내드립니다.','집에서도 쉽게 따라 할 수 있는 홈베이킹을 중심으로, 브라우니, 마카롱, 타르트 등 다양한 디저트를 만드는 방법을 배웁니다.','최도현 셰프는 홈베이킹 전문 강사로, 온라인 플랫폼에서 베이킹 관련 수업을 꾸준히 진행하고 있습니다.','다양한 디저트를 손쉽게 만들 수 있도록 도와주는 것이 강의의 목표입니다.','베이킹에 대한 기초 지식이 필요하지만, 초보자도 쉽게 배울 수 있는 과정입니다.'),(6,_binary '','2024-08-22 06:45:00.000000','2024-08-28 02:57:21.000000',6,'105','기타 연주 마스터: 기본 코드부터 고급 리프까지',NULL,'매주 토요일 오전 10시에 시작되며, 첫 강의는 2024년 9월 10일입니다. 기타와 튜너를 준비해주세요.','이 강의는 기본적인 코드 진행부터 고급 리프까지 기타 연주의 모든 것을 다룹니다. 실전에서 사용되는 연주 기법을 자세히 배웁니다.','윤지호 강사는 기타 연주자로서 여러 밴드와 협업한 경험을 바탕으로, 실전에서 활용할 수 있는 연주법을 가르칩니다.','초보자도 쉽게 배울 수 있는 기타 기본 연주부터, 고급 테크닉까지 섭렵하는 것이 목표입니다.','기본적인 기타 연주 경험이 있으면 좋습니다.'),(7,_binary '','2024-08-22 06:50:00.000000','2024-08-28 13:14:42.424228',7,'106','홈트레이닝: 하루 30분으로 만드는 건강한 몸',NULL,'매주 화요일과 금요일 오전 9시에 진행되며, 첫 수업은 2024년 9월 12일에 시작됩니다. 준비물은 요가 매트와 물통입니다.','이 강의는 집에서도 간단히 할 수 있는 전신 운동을 중심으로 구성되어 있으며, 하루 30분씩 운동하여 체력을 기르는 방법을 배웁니다.','장민서 트레이너는 홈트레이닝 전문 강사로서, 여러 유명 피트니스 프로그램의 트레이너로 활동한 경험이 있습니다.','기구 없이도 할 수 있는 전신 운동을 통해 건강한 신체를 만드는 것이 목표입니다.','별도의 운동 경험 없이 누구나 쉽게 따라 할 수 있습니다.'),(8,_binary '','2024-08-22 06:55:00.000000',NULL,8,'107','매일 실천하는 라이프스타일 변화의 기술',NULL,'첫 강의는 2024년 9월 8일이며, 매주 화요일 오후 4시에 진행됩니다. 강의 중 실습을 통해 변화를 직접 체험할 수 있습니다.','생활 습관을 개선하여 더 나은 삶을 살 수 있도록 돕는 라이프스타일 코칭 프로그램입니다. 작은 변화가 큰 결과를 만들어내는 방법을 배웁니다.','한예원 라이프스타일 코치는 다양한 라이프스타일 워크샵을 운영해왔으며, 실질적인 변화를 이끌어내는 데 탁월한 성과를 보여주었습니다.','라이프스타일을 개선하여 지속 가능한 변화를 이끌어내는 것이 목표입니다.','자신의 생활 패턴에 대해 열린 마음으로 접근할 준비가 필요합니다.'),(9,_binary '','2024-08-22 07:00:00.000000',NULL,9,'108','사진의 예술: 구도와 조명을 활용한 작품 만들기',NULL,'강의는 2024년 9월 20일 시작되며 매주 목요일 저녁 6시에 진행됩니다. 카메라 및 렌즈 준비가 필요합니다.','이 강의는 사진의 구도와 조명 사용법에 대해 중점적으로 다루며, 작품 사진을 완성하는 기법을 학습합니다. 실제 촬영 실습을 통해 다양한 상황에서의 응용력을 배웁니다.','김시우 작가는 사진 작가로서 여러 국내외 전시회에 참가한 경력을 가지고 있으며, 독창적인 사진 스타일로 유명합니다.','구도와 조명을 활용해 사진의 예술적 완성도를 높이는 것이 목표입니다.','카메라 사용 경험과 기본적인 사진 촬영 지식이 요구됩니다.'),(10,_binary '','2024-08-22 07:05:00.000000',NULL,10,'109','현명한 재테크: 초보자를 위한 첫 걸음',NULL,'매주 수요일 오후 3시에 시작되며, 첫 수업은 2024년 9월 15일에 진행됩니다. 기본적인 금융 용어에 대한 이해가 필요합니다.','이 강의는 재테크 초보자를 위한 기초부터 시작하여, 돈을 현명하게 관리하는 방법을 배웁니다. 금융 상품의 이해와 투자 전략을 다룹니다.','신은서 재테크 전문가는 10년 이상 금융업계에서 활동해왔으며, 다수의 세미나와 강연을 통해 개인 재무 관리법을 가르쳐 왔습니다.','재테크 초보자도 쉽게 따라 할 수 있도록, 기본 금융 상품에 대한 이해부터 전략적인 투자 방법을 배우는 것이 목표입니다.','기본적인 재무 지식이 있으면 좋습니다.'),(11,_binary '','2024-08-22 07:10:00.000000','2024-08-27 21:24:45.606607',11,'110','성공적인 창업을 위한 필수 전략',NULL,'첫 수업은 2024년 9월 22일 시작되며 매주 월요일 오후 5시에 진행됩니다. 강의 중 창업 관련 실습이 포함됩니다.','이 강의는 창업 초보자들이 알아야 할 필수 전략과 창업 초기 단계에서 겪는 문제 해결 방법을 중심으로 진행됩니다.','오서연 강사는 5개의 스타트업을 창업한 경험이 있으며, 현재도 다수의 창업 컨설팅을 진행하고 있습니다.','성공적인 창업을 위한 구체적인 비즈니스 모델을 수립하는 것이 목표입니다.','창업에 대한 기본 아이디어와 비즈니스 모델에 대한 기초 지식이 필요합니다.'),(12,_binary '','2024-08-22 07:15:00.000000',NULL,12,'111','성공 마인드: 긍정적 사고의 힘',NULL,'강의는 2024년 9월 10일 시작되며 매주 수요일 오후 4시에 진행됩니다. 간단한 과제와 일상에서 실천할 수 있는 훈련이 포함됩니다.','성공을 위해 필요한 긍정적 사고방식을 체계적으로 배우고, 이를 실생활에서 어떻게 적용할 수 있는지 학습하는 강의입니다.','류지성 코치는 10년간 자기계발 및 성공 마인드에 대해 강연을 해왔으며, 수많은 개인이 성공적인 삶을 살 수 있도록 도왔습니다.','성공적인 마인드를 확립하고 이를 통해 더 나은 삶을 살 수 있는 능력을 기르는 것이 목표입니다.','성공을 향한 열정과 긍정적인 마인드가 필요합니다.'),(13,_binary '','2024-08-22 07:20:00.000000',NULL,13,'112','파이썬 기초부터 실전까지: 프로그래밍 입문',NULL,'강의는 2024년 9월 18일에 시작되며 매주 금요일 오후 2시에 진행됩니다. 실습 위주의 수업으로, 개인 노트북이 필요합니다.','이 강의는 프로그래밍 초보자들이 파이썬을 기초부터 배워 실전 프로젝트를 수행할 수 있도록 도와줍니다.','김하린 교수는 소프트웨어 개발 분야에서 15년간의 경력을 가지고 있으며, 다수의 프로젝트를 수행한 경험이 있습니다.','기초 문법에서부터 실전 프로그래밍까지 익히고, 자신만의 프로젝트를 완성하는 것을 목표로 합니다.','프로그래밍 경험이 없더라도 수강 가능합니다.'),(14,_binary '','2024-08-22 07:25:00.000000',NULL,14,'113','스티븐 끈적끈적',NULL,'강의는 매주 화요일 오후 6시에 진행되며 첫 수업은 2024년 9월 20일에 시작됩니다. 개인 노트북이 필요하며, 파이썬 설치가 필요합니다.','데이터 분석의 기본부터 시작하여, 실제 데이터를 활용한 분석 방법을 배웁니다. 기초적인 통계와 데이터 시각화 기술도 함께 다룹니다.','백준서 교수는 데이터 사이언스 분야에서 다년간 연구와 강의를 해왔으며, 다수의 데이터 분석 프로젝트를 수행한 전문가입니다.','기초 통계학과 데이터 분석 방법을 익혀 실제 프로젝트에서 활용할 수 있는 역량을 기르는 것이 목표입니다.','파이썬과 기본적인 통계 지식이 있으면 좋습니다.'),(15,_binary '','2024-08-22 07:30:00.000000',NULL,15,'114','성공적인 제품 기획: 아이디어에서 실행까지',NULL,'첫 수업은 2024년 9월 25일에 시작되며 매주 목요일 오후 3시에 진행됩니다. 제품 기획 실습이 포함되어 있습니다.','이 강의는 제품 기획의 기초부터 아이디어 발상법, 실행 계획 수립까지의 전 과정을 배울 수 있습니다.','박다인 교수는 다수의 제품 기획을 성공적으로 수행한 경험을 바탕으로, 실제 시장에서 제품이 성공할 수 있는 전략을 가르칩니다.','제품 기획에 필요한 기본적인 기획 방법론을 배우고, 성공적인 제품을 기획하는 능력을 기르는 것이 목표입니다.','기본적인 시장 조사 능력이 있으면 좋습니다.'),(16,_binary '','2024-08-22 07:35:00.000000',NULL,16,'115','비즈니스 커뮤니케이션: 성공적인 협상 전략',NULL,'강의는 매주 월요일 오전 11시에 시작되며, 2024년 9월 30일 첫 수업이 시작됩니다. 강의 중 실습을 통해 협상 기술을 배우게 됩니다.','성공적인 비즈니스를 위한 필수 기술인 협상력을 배웁니다. 다양한 사례를 통해 실전에서 활용할 수 있는 전략을 학습합니다.','김도윤 교수는 비즈니스 커뮤니케이션 전문가로, 다수의 글로벌 협상 경험을 바탕으로 실전 전략을 가르칩니다.','협상과 커뮤니케이션 스킬을 배우고, 비즈니스 상황에서 이를 적용할 수 있는 능력을 기르는 것이 목표입니다.','비즈니스 환경에 대한 기본적인 이해가 있으면 좋습니다.'),(17,_binary '','2024-08-22 07:40:00.000000',NULL,17,'116','생산성 향상을 위한 스마트 워크 기술',NULL,'첫 수업은 2024년 10월 5일에 시작되며 매주 금요일 오후 1시에 진행됩니다. 노트북과 스마트폰이 필요합니다.','효율적인 업무 처리와 시간 관리를 위한 다양한 스마트 워크 도구와 기술을 배웁니다. 실습을 통해 즉시 적용할 수 있는 방법을 익힙니다.','조하율 교수는 생산성 관리 전문가로, 다수의 기업에서 생산성 향상을 위한 컨설팅을 제공해왔습니다.','업무 효율성을 높이고 시간을 절약하는 다양한 기술을 배워, 실제 업무에 적용하는 것이 목표입니다.','기본적인 컴퓨터 및 스마트폰 사용 능력이 필요합니다.'),(18,_binary '','2024-08-22 07:45:00.000000',NULL,18,'117','디지털 마케팅 기초부터 고급까지: 실전 전략',NULL,'강의는 매주 목요일 오후 7시에 진행되며, 첫 수업은 2024년 9월 28일에 시작됩니다. 개인 노트북을 준비해주세요.','디지털 마케팅의 기본부터 고급 전략까지 배우는 강의로, 다양한 온라인 마케팅 도구와 데이터를 분석하는 방법을 다룹니다.','송지아 교수는 디지털 마케팅 분야에서 다수의 캠페인을 성공적으로 이끌었으며, 데이터 기반 마케팅 전략에 정통합니다.','디지털 마케팅의 기초부터 고급 전략까지 배우고, 이를 실전에서 활용하는 능력을 기르는 것이 목표입니다.','기본적인 마케팅 개념을 알고 있으면 좋습니다.'),(19,_binary '','2024-08-22 07:50:00.000000',NULL,19,'118','UI/UX 디자인 기초: 사용자 중심의 디자인 철학',NULL,'첫 수업은 2024년 9월 12일에 시작되며 매주 수요일 오후 2시에 진행됩니다. 디자인 도구는 사전에 안내드립니다.','사용자 경험(UX)과 사용자 인터페이스(UI)의 기초를 배우고, 실습을 통해 사용자 친화적인 디자인을 만드는 방법을 익힙니다.','이건우 교수는 UI/UX 디자인 전문가로, 여러 디지털 제품의 사용자 경험 설계를 성공적으로 이끌어낸 경력이 있습니다.','사용자 중심의 디자인을 이해하고, 이를 실전 프로젝트에 적용하는 것이 목표입니다.','기본적인 디자인 지식이 필요합니다.'),(20,_binary '','2024-08-22 07:55:00.000000',NULL,20,'119','영상 편집 마스터 클래스: 프리미어 프로 실습',NULL,'강의는 매주 화요일 오후 5시에 진행되며, 2024년 9월 19일 첫 수업이 시작됩니다. 개인 노트북과 프리미어 프로 설치가 필요합니다.','이 강의는 프리미어 프로를 사용하여 고급 영상 편집 기술을 배우는 과정입니다. 실제 프로젝트를 통해 편집 기법을 익히고, 영상의 완성도를 높이는 방법을 학습합니다.','정서현 교수는 영상 편집 전문가로, 다수의 영화 및 광고 편집 프로젝트를 수행한 경험이 있습니다.','영상 편집 기술을 숙달하고, 실제 작업에서 활용할 수 있는 실무 능력을 기르는 것이 목표입니다.','기본적인 컴퓨터 활용 능력이 필요합니다.'),(21,_binary '','2024-08-22 08:00:00.000000',NULL,21,'100','영어 회화: 실전에서 바로 쓰는 표현',NULL,'강의는 매주 화요일 오후 7시에 시작되며, 2024년 10월 1일 첫 수업이 진행됩니다. 준비물은 개인 노트북과 이어폰입니다.','이 강의는 실생활에서 바로 사용할 수 있는 영어 표현을 중점적으로 배우는 과정입니다. 대화 연습을 통해 자연스러운 회화를 목표로 합니다.','김서준 교수는 5년간 영어 회화 강의를 진행해 왔으며, 다양한 국제 무대에서의 경험을 바탕으로 실전적인 영어 교육을 제공합니다.','실전에서 영어 회화를 자유롭게 할 수 있도록 돕는 것이 목표입니다.','기본적인 영어 문법과 어휘가 있으면 좋습니다.'),(22,_binary '','2024-08-22 08:05:00.000000',NULL,22,'101','TOEIC 900점 달성 비법',NULL,'매주 수요일 오후 5시에 진행되며, 첫 수업은 2024년 10월 2일에 시작됩니다. 준비물은 토익 기출 문제집입니다.','이 강의는 TOEIC 시험 준비를 위한 전략과 실전 문제 풀이 방법을 배우는 과정입니다. 각 파트별 고득점 전략을 중점적으로 다룹니다.','이지아 강사는 TOEIC 고득점 달성을 위한 전략적인 접근법을 가르치며, 다년간의 경험을 바탕으로 수많은 학생들이 목표 점수를 달성할 수 있도록 도왔습니다.','TOEIC 시험에서 900점 이상을 달성하는 것을 목표로 합니다.','기본적인 영어 실력과 시험 경험이 필요합니다.'),(23,_binary '','2024-08-22 08:10:00.000000',NULL,23,'102','일본어 N1 대비 고급 회화',NULL,'첫 수업은 2024년 10월 3일에 시작되며, 매주 목요일 오후 7시에 진행됩니다. 교재는 사전에 안내드립니다.','일본어 능력 시험 N1을 준비하는 고급 일본어 학습자를 위한 강의입니다. 고급 회화와 작문, 독해 능력을 함께 향상시킵니다.','박하준 강사는 일본어 교육 전문가로, JLPT N1 시험을 위한 전략과 고급 회화 능력을 체계적으로 가르칩니다.','일본어 N1 시험에서 고득점을 달성하고, 실전에서 활용할 수 있는 고급 회화 능력을 기르는 것이 목표입니다.','JLPT N2 이상 혹은 이에 상응하는 일본어 실력이 필요합니다.'),(24,_binary '','2024-08-22 08:15:00.000000',NULL,24,'103','아이를 위한 창의력 개발 프로그램',NULL,'강의는 2024년 10월 4일 시작되며 매주 금요일 오전 10시에 진행됩니다. 준비물은 각종 미술 재료가 필요합니다.','이 강의는 아이들의 창의력과 문제 해결 능력을 개발하기 위한 다양한 활동을 제공합니다. 미술과 놀이를 접목한 창의력 훈련이 중점입니다.','정유나 교수는 유아 교육 전문가로, 창의력 교육과 놀이 치료를 접목한 프로그램을 다년간 진행해왔습니다.','아이들이 자유롭게 창의성을 발휘하고 문제 해결 능력을 기르는 것이 목표입니다.','특별한 사전 준비물은 없지만, 아이와 함께하는 참여가 필요합니다.'),(25,_binary '','2024-08-22 08:20:00.000000',NULL,25,'104','부모 교육: 자녀와의 소통 기술',NULL,'매주 월요일 오전 11시에 진행되며, 첫 수업은 2024년 10월 7일에 시작됩니다. 강의 중 실습 시간이 포함됩니다.','이 강의는 자녀와의 소통을 원활하게 하기 위한 다양한 기술과 방법을 배우는 과정입니다. 감정 이해와 공감 훈련을 중점으로 다룹니다.','최도현 교수는 부모 교육 전문가로서, 수많은 부모들에게 자녀와의 관계 개선을 위한 실질적인 조언을 제공해 왔습니다.','부모가 자녀와 효과적으로 소통하고, 감정을 이해할 수 있는 능력을 기르는 것이 목표입니다.','자녀와의 소통에 어려움을 겪는 부모님들에게 추천합니다.'),(20,_binary '','2024-08-22 08:25:00.000000',NULL,26,'105','3D 애니메이션 기초: 마야(Maya) 사용법',NULL,'첫 수업은 2024년 10월 8일에 시작되며 매주 화요일 오후 4시에 진행됩니다. 준비물은 개인 노트북