5:00.000000',NULL,42,'101','성공적인 마인드셋: 인생을 바꾸는 사고방식',NULL,'첫 수업은 2024년 11월 12일에 시작되며, 매주 목요일 오후 7시에 진행됩니다. 준비물은 필기구와 노트입니다.','이 강의는 성공적인 인생을 살기 위해 필수적인 긍정적 마인드셋과 자신감을 기르는 방법을 배웁니다. 사고방식의 변화를 통해 더 나은 결과를 얻는 기술을 익힙니다.','이지아 교수는 마인드셋 코칭 전문가로, 다수의 개인과 기업을 대상으로 자기계발과 성공적인 사고방식에 대한 강연을 해왔습니다.','긍정적인 사고방식을 개발하고, 이를 통해 삶에서 더 큰 성과를 내는 것이 목표입니다.','열린 마음과 실천 의지가 필요합니다.'),(13,_binary '','2024-08-22 09:50:00.000000',NULL,43,'102','코딩 초보자를 위한 Python 기초 과정',NULL,'강의는 2024년 11월 15일에 시작되며, 매주 토요일 오전 10시에 진행됩니다. 준비물은 개인 노트북입니다.','이 강의는 프로그래밍 경험이 없는 초보자들을 위해 Python의 기초 문법부터 시작하여 실습 중심으로 진행됩니다. 간단한 프로젝트를 통해 실전 프로그래밍 스킬을 배웁니다.','박하준 교수는 소프트웨어 개발 전문가로, 다수의 Python 프로젝트를 수행한 경력이 있습니다.','Python을 사용한 프로그래밍 기초를 습득하고, 실전에서 활용할 수 있는 능력을 기르는 것이 목표입니다.','프로그래밍 경험이 없어도 수강 가능합니다.'),(14,_binary '','2024-08-22 09:55:00.000000',NULL,44,'103','데이터 시각화: Python과 Tableau로 배우는 실전 데이터 분석',NULL,'첫 수업은 2024년 11월 17일에 시작되며, 매주 월요일 오후 3시에 진행됩니다. 개인 노트북과 Python 설치가 필요합니다.','이 강의는 데이터를 효과적으로 분석하고 시각화하는 방법을 배웁니다. Python과 Tableau를 사용하여 실전 데이터 분석 프로젝트를 진행합니다.','정유나 교수는 데이터 분석 전문가로, 다수의 프로젝트에서 데이터를 기반으로 한 비즈니스 전략을 수립해왔습니다.','데이터 시각화 기술을 배우고, 이를 통해 데이터에서 통찰을 얻는 능력을 기르는 것이 목표입니다.','기초 Python 문법과 통계 지식이 있으면 좋습니다.'),(15,_binary '','2024-08-22 10:00:00.000000',NULL,45,'104','제품 기획: 시장 조사부터 실행 전략까지',NULL,'강의는 매주 수요일 오후 4시에 진행되며, 첫 수업은 2024년 11월 19일에 시작됩니다. 시장 조사 자료 준비가 필요합니다.','이 강의는 성공적인 제품 기획을 위한 전 과정을 다룹니다. 시장 조사 방법론, 타겟 설정, 실행 전략까지 체계적으로 배울 수 있습니다.','최도현 교수는 제품 기획 전문가로서 다수의 글로벌 기업에서 제품 기획 프로젝트를 이끌어 온 경력을 가지고 있습니다.','시장에서 성공할 수 있는 제품을 기획하고 실행 전략을 수립하는 것이 목표입니다.','기초적인 시장 조사 경험이 있으면 좋습니다.'),(16,_binary '','2024-08-22 10:05:00.000000',NULL,46,'105','비즈니스 성공을 위한 협상 기술',NULL,'첫 수업은 2024년 11월 22일에 시작되며, 매주 금요일 오전 9시에 진행됩니다. 실습을 통해 다양한 협상 전략을 배웁니다.','이 강의는 성공적인 비즈니스 협상을 이끌어내기 위한 전략과 기술을 배우는 과정입니다. 실제 사례를 바탕으로 실전 협상 기법을 익힙니다.','윤지호 교수는 협상 전문가로, 다수의 글로벌 협상 프로젝트에서 성과를 거둔 경험을 바탕으로 협상 기술을 가르칩니다.','협상 전략을 체계적으로 배우고, 실전에서 이를 효과적으로 적용하는 능력을 기르는 것이 목표입니다.','기본적인 비즈니스 운영 지식이 있으면 좋습니다.'),(17,_binary '','2024-08-22 10:10:00.000000',NULL,47,'106','시간 관리와 생산성 향상 기법: 효율적인 일상 만들기',NULL,'강의는 매주 월요일 오전 9시에 진행되며, 첫 수업은 2024년 11월 25일에 시작됩니다. 간단한 실습과 계획표 작성을 진행합니다.','이 강의는 시간을 효율적으로 관리하고 생산성을 극대화하는 방법을 배웁니다. 일상에서 바로 적용할 수 있는 다양한 도구와 기법을 학습합니다.','장민서 교수는 시간 관리와 생산성 향상에 대한 컨설팅을 제공하며, 다양한 워크숍을 통해 수많은 개인과 기업에게 도움을 주었습니다.','효율적인 시간 관리 기법을 통해 생산성을 향상시키고, 일상에서 이를 실천하는 능력을 기르는 것이 목표입니다.','기본적인 시간 관리 도구 사용 경험이 있으면 좋습니다.'),(18,_binary '','2024-08-22 10:15:00.000000',NULL,48,'107','디지털 마케팅의 모든 것: 페이스북 광고부터 분석까지',NULL,'첫 수업은 2024년 11월 27일에 시작되며, 매주 화요일 오후 5시에 진행됩니다. 개인 노트북과 페이스북 광고 계정이 필요합니다.','이 강의는 디지털 마케팅 초보자들을 위해 페이스북 광고를 중심으로 디지털 광고의 기본 개념과 실전 기법을 배웁니다. 광고 데이터를 분석하고, 이를 통해 성과를 향상시키는 방법을 학습합니다.','한예원 교수는 디지털 마케팅 전문가로서, 다양한 브랜드의 광고 캠페인을 성공적으로 이끈 경험을 가지고 있습니다.','페이스북 광고 운영을 통해 디지털 마케팅 성과를 극대화하는 것이 목표입니다.','기초적인 마케팅 지식이 있으면 좋습니다.'),(19,_binary '','2024-08-22 10:20:00.000000',NULL,49,'108','UX 디자인 실무: 사용자 중심의 웹사이트 설계',NULL,'강의는 2024년 12월 1일 시작되며, 매주 목요일 오후 6시에 진행됩니다. 개인 노트북과 디자인 도구가 필요합니다.','이 강의는 UX 디자인의 기초부터 실제 웹사이트 설계까지 다룹니다. 사용자 경험을 최적화하기 위한 다양한 디자인 기법을 실습합니다.','김시우 교수는 UX 디자인 전문가로, 다수의 웹사이트와 애플리케이션 UX 설계를 성공적으로 수행한 경력을 가지고 있습니다.','사용자 중심의 웹사이트를 설계하고, 이를 실무에 적용할 수 있는 능력을 기르는 것이 목표입니다.','기본적인 디자인 도구 사용 경험이 있으면 좋습니다.'),(20,_binary '','2024-08-22 10:25:00.000000',NULL,50,'109','영상 편집 심화 과정: 다빈치 리졸브를 활용한 색보정 기법',NULL,'강의는 매주 금요일 오후 7시에 진행되며, 2024년 12월 3일에 첫 수업이 시작됩니다. 다빈치 리졸브 소프트웨어가 필요합니다.','이 강의는 다빈치 리졸브를 사용하여 고급 영상 색보정 기술을 배우는 심화 과정입니다. 다양한 영상의 색감을 조정하고 작품을 더욱 돋보이게 만드는 기술을 익힙니다.','신은서 교수는 영상 색보정 전문가로, 다수의 영화 및 광고 프로젝트에서 색보정을 담당한 경력이 있습니다.','고급 색보정 기술을 익히고, 이를 통해 영상을 더욱 생동감 있게 표현하는 능력을 기르는 것이 목표입니다.','기초적인 영상 편집 경험이 필요합니다.'),(2,_binary '\0','2024-09-04 16:12:56.753898','2024-09-13 08:42:10.381560',77,'3679445680','왜 안돼',NULL,NULL,'짜증나','되라고','돼라','안녕'),(5,_binary '\0','2024-09-04 16:19:11.551551','2024-09-24 05:59:28.984796',78,'3679461327','개 큰 강의 시작',NULL,NULL,'우주를 정복한다구요','','우주 정복',''),(7,_binary '\0','2024-09-04 16:20:56.124751','2024-09-24 05:59:36.027058',79,'3679461327','아침 운동 두 번이면 죽는 헤이즐리',NULL,NULL,